using System;
using System.Diagnostics;
using System.Text;

namespace Day05
{
    class Program
    {
        static void Main(string[] args)
        {
            // Do JIT compilation
            partOne();
            partTwo();

            Console.Clear();

            Stopwatch watch = Stopwatch.StartNew();

            Console.WriteLine("Part one");
            watch.Restart();
            partOne();
            watch.Stop();
            Console.WriteLine($"Done in: {watch.Elapsed.TotalMilliseconds}ms");

            Console.WriteLine("Part two");
            watch.Restart();
            partTwo();
            watch.Stop();
            Console.WriteLine($"Done in: {watch.Elapsed.TotalMilliseconds}ms");

            Console.ReadLine();
        }

        static void partOne()
        {
            partOne(inputValuesTest);
            partOne(realInputValues);
        }

        static void partOne(string value)
        {
            StringBuilder stringBuilder = new StringBuilder(value);

            bool removed = true;

            while (removed)
            {
                removed = false;

                for (int i = 0; i < stringBuilder.Length - 1; i++)
                {
                    char current = stringBuilder[i];
                    char next = stringBuilder[i + 1];

                    if ((char.IsLower(current) && char.IsUpper(next) && current == char.ToLower(next)) ||
                        (char.IsUpper(current) && char.IsLower(next) && current == char.ToUpper(next)))
                    {
                        removed = true;

                        stringBuilder.Remove(i, 2);

                        i += 2;
                    }
                }
            }

            Console.WriteLine(stringBuilder.Length + ": " + stringBuilder);
        }

        static void partTwo()
        {
            partTwo(inputValuesTest);
            partTwo(realInputValues);
        }

        static void partTwo(string value)
        {
            int shortestLength = value.Length;
            char? shortestLengthChar = null;

            foreach (char alphabetChar in alphabet)
            {
                string valueTemp = value;

                valueTemp = valueTemp.Replace(alphabetChar.ToString(), "");
                valueTemp = valueTemp.Replace(char.ToUpper(alphabetChar).ToString(), "");

                StringBuilder stringBuilder = new StringBuilder(valueTemp);

                bool removed = true;

                while (removed)
                {
                    removed = false;

                    for (int i = 0; i < stringBuilder.Length - 1; i++)
                    {
                        char current = stringBuilder[i];
                        char next = stringBuilder[i + 1];

                        if ((char.IsLower(current) && char.IsUpper(next) && current == char.ToLower(next)) ||
                            (char.IsUpper(current) && char.IsLower(next) && current == char.ToUpper(next)))
                        {
                            removed = true;

                            stringBuilder.Remove(i, 2);

                            i += 2;
                        }
                    }
                }

                if (stringBuilder.Length < shortestLength)
                {
                    shortestLength = stringBuilder.Length;
                    shortestLengthChar = alphabetChar;
                }
            }

            Console.WriteLine(shortestLengthChar + ": " + shortestLength);
        }

        static string alphabet = "abcdefghijklmnopqrstuvwxyz";

        static string inputValuesTest = "dabAcCaCBAcCcaDA";

        static string realInputValues = "";
    }
}
